    function pingPongElPosition(el, anchorX, anchorY, startPos, endPos, cPos, totalTime, timeLeft, currTime, direction, tween) {
      if (!tween) {
        tween = {isContinue: true};
      }

      const timeDelta = performance.now() - currTime;

      const velX = direction > 0? (endPos.x - cPos.x) / timeLeft: (startPos.x - cPos.x) / timeLeft;
      const velY = direction > 0? (endPos.y - cPos.y) / timeLeft: (startPos.y - cPos.y) / timeLeft;

      cPos.x += velX * timeDelta;
      cPos.y += velY * timeDelta;

      setSpritePos(el, cPos.x, cPos.y, anchorX, anchorY);

      timeLeft -= timeDelta;
      currTime = performance.now();

      if (tween.isContinue) {
        if (timeLeft > 0) {
          setTimeout(() => pingPongElPosition(el, anchorX, anchorY, startPos, endPos, cPos, totalTime, timeLeft, currTime, direction, tween), 17);
        } else {
          if (direction > 0) {
            cPos.x = endPos.x;
            cPos.y = endPos.y;
            direction = -1;
          } else {
            cPos.x = startPos.x;
            cPos.y = startPos.y;
            direction = 1;
          }
          timeLeft = totalTime;
          setTimeout(() => pingPongElPosition(el, anchorX, anchorY, startPos, endPos, cPos, totalTime, timeLeft, currTime, direction, tween), 17);
        }
      }
      
      return tween;
    }


